import React, { useState } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import axios from 'axios';
import logo from './logo192.png';
import './App.css';

var test = 0;

function App() {
  return (
    <Router>
      <div class="container">
        <header>
          <nav>
            <ul>
              <li> <Link to="/">Home</Link></li>
              <li> <Link to="tiktak">Tic tak toe</Link></li>
            </ul>
          </nav>
          <div class="img-container">
            <img src={logo} class="bordered-image" />
          </div>
          <div>A site for playing react games</div>
        </header>
        <section id="main">
          <noscript>You need to enable JavaScript to run this app.</noscript>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/tiktak">
              <Tiktak />
            </Route>
          </Switch>
        </section>
        <footer>
          &copy; Gilad sefti
  </footer>
      </div>
    </Router>
  );
}
function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  )
}
function Tiktak() {
  return (
    <div>
      <h2>Tiktak</h2>
    </div>
  )
}

export default App;
